import React, {Component} from 'react';
import api from '../../services/api';

export default class Main extends Component{

    constructor(){
        super();

        this.state = { 
            response: null
        }
    }

    loadProducts = async () => {
        this.state.response = await api.get('/products');
        console.log(this.state.response.data.docs)
    }


    componentDidMount(){
        this.loadProducts();
    }



    render(){
        return <pre> {this.state.response} </pre>
    }
}
